function setSkills(t){var e=t.querySelectorAll("a"),n=52.5/Math.tan(Math.PI/e.length)/Math.cos(Math.PI/e.length);t.style.height=2*n+70+"px",t.style.width=2*n+70+"px",Array.from(e).forEach((t,a)=>{t.style.left=n+n*Math.cos(2*Math.PI*a/e.length)+"px",t.style.top=n+n*Math.sin(2*Math.PI*a/e.length)+"px",t.addEventListener("click",(function(e){e.preventDefault(),t.classList.add("active"),setTimeout(()=>{window.location.href=t.getAttribute("href")},800)}))})}function canUseWebP(){var t=document.createElement("canvas");return!(!t.getContext||!t.getContext("2d"))&&0==t.toDataURL("image/webp").indexOf("data:image/webp")}document.addEventListener("DOMContentLoaded",(function(t){canUseWebP()?document.body.classList.add("webp"):document.body.classList.add("no-webp")})),window.addEventListener("load",(function(t){var e=document.querySelector(".skills");e&&setSkills(e)}));